import './App.css';

function App() {
  return (
    <main>
      <header>
        <a href="" className="logo">PRETA</a>
        <nav>
          <a href="">Login</a>
          <a href="">Register</a>
        </nav>
      </header>
      <div className="post">
        <img src="https://ichef.bbci.co.uk/news/800/cpsprodpb/9EFB/production/_112899604_dsc05926-edit.jpg"></img>
        <h2>Celebrating Yoruba fashion in a stunning series of images.</h2>
        <p>The Yoruba fashion has evolved to incorporate trends, from flared sleeves to puff sleeves to off-shoulder blouses and narrower collars.
           Materials that weren't traditionally used, from chiffon to organza are now being worn and most importantly, the outfits that were traditionally loose are now more fitted. 
        </p>
      </div>

    </main>
  );
}

export default App;
